import React, { Component } from "react";
import Weather from "./Weather";

class Home extends Component {
  render() {
    const { city } = this.props.match.params.id;
    return (
      <React.Fragment>
        <h1>Home</h1>
        <Weather targetCity={city} />
      </React.Fragment>
    );
  }
}

export default Home;
